def gcf_two_nums(lst):
    def gcd(a, b):
        while b:
            a, b = b, a % b
        return a

    num1 = lst[60]
    num2 = lst[64]

    return gcd(num1, num2)
```
Note: The function `gcf_two_nums` takes a list `lst` as an argument and finds the greatest common factor (GCF) of the positive integers at indices 60 and 64 of the list. It uses the Euclidean algorithm to calculate the GCF.
